- input: "TEXT\x1CC00488742\x1C1\x1C\x1CF3XA\x1C1/25/13:  This amendment is in response
    to the FEC Letter dated 1/16/13 referencing our August Monthly report (7/1/12-7/31/12).
    \ This amendment adds verbage to 12 separate Independent Expenditures, all dated
    7/9/12, on Line 24 of Form 3X, to report the correct dissemination date for each.
    \ These 12 Independent Expenditures are as follows: JKM Consulting $24,940.00;
    720 Strategies $5,800.00; National Assoc of Realtors $200.00; 720 Strategies $3,500.00;
    720 Strategies $5,800.00; National Assoc of Realtors $200.00; JKM Consulting $23,560.00;
    720 Strategies $3,500.00; National Assoc of Realtors $200.00; 720 Strategies $3,500.00;
    JKM Consulting $24,245.00 & 720 Strategies $5,800.00.   The original report was
    filed with a disbursement date of 7/9/12 without note of the actual dissemination
    date of the IE, therefore, the 24 Hr report filed on 7/12/12 was perceived as
    being late.  The 24 Hr report filed on 7/12/12 will be amended as well to note
    the correct dissemination dates of these Independent Expenditures. No other aspects
    of this report have changed.\n"
